?><p align="justify"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Марка Atlantic начинает свою историю в 1888 году. Сначала компания изготовляла детали для карманных часов, пользовавшихся огромной популярностью в то время. Общемировую популярность бренд завоевал в 1954 году (в этом же году бренд сменил свое название), когда были изготовлены одни из первых европейских водонепроницаемых часов. Сегодня же компания Atlantic представляет порядка сотни разновидностей мужских и женских наручных часов. Марка отличается своей оригинальной сборкой в Швейцарии, множество функций, использование швейцарских механизмов ETA и удобство всех моделей. Часы Atlantic подходят для людей, которые предпочитают спорт и ведут активную жизнь. Некоторые модели имеют очень высокую водонепроницаемость до двухсот метров. 
